import logo from './logo.svg';
import './App.css';
import {Card, Button, FormControl, InputGroup} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={`https://app.dtac.co.th/vaccine/assets/images/banner/WebBanner-desktop-1120x400-Th_2022-Apr-28.jpg`} alt="logo" />
        <Card className="text-center">
  <Card.Header style={{color: 'black'}}>Featured</Card.Header>
  <Card.Body style={{color: 'black'}}>
    <Card.Title>กรุณากรอกรหัสบัตรประชาชน</Card.Title>
    <InputGroup className="mb-3">
    <InputGroup.Text id="uid">@</InputGroup.Text>
    <FormControl
      placeholder="รหัสบัตรประจำตัวประชาชน"
      aria-label="uid"
    />
  </InputGroup>
    <Button variant="primary">Go somewhere</Button>
  </Card.Body>
  <Card.Footer className="text-muted">2 days ago</Card.Footer>
</Card>
      </header>
    </div>
  );
}

export default App;
